import React from 'react'
import './ProductCarousel.css';
import { motion } from 'framer-motion';

const Hero = () => {
    return (
        <section>
            <div className='overlay'>
                <motion.div 
                animate={{ scale: [1, 1, 1, 1, 1],
                    rotate: [0, 90, 180, 360 ],
                    borderRadius: ["20%", "20%", "20%", "20%", "20%"], }}

                className='overlay-text'>
                    Tacos Shop
                </motion.div>
            </div>
        </section>
    )
}

export default Hero
